import React, {Component} from 'react';
import Profile from './pages/Header/Profile.js'


class App extends Component {
  constructor() {
    super();
    this.state={
      NickName:'kevin',
      Level:100
    }
  }
  render() {
    return (
      <div>
        <Profile {...this.state}></Profile>
      </div>
    );
  }
}

export default App;
